webpackJsonp([0xf927f8900006],{351:function(A,e){A.exports={data:{site:{siteMetadata:{title:"Blog by Jingzhou Luo",subtitle:"Also go by Joe. Software Engineer, Seahawk Fan, Spicy Foody",copyright:"© All rights reserved.",menu:[{label:"Articles",path:"/"},{label:"About me",path:"/about/"}],author:{name:"Jingzhou Luo",email:"luojingzhou at gmail",telegram:"#",twitter:"#",github:"#",rss:"#",vk:"#"}}},markdownRemark:{id:"/Users/jingzhou/repos/jingzhou-blog/src/pages/pages/2018-02-11---about/index.md absPath of file >>> MarkdownRemark",html:'<p>Focused on Risk/Trust/AntiFraud industry and technologies, distributed system, micro services, machine learning, and data visualization. <br/>\nWorking at Airbnb Risk Engineering. Was at AWS Fraud team before.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1-60fea4c6e45ceda49cc13c40965ddef4-5b032.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 960px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Just want to start using this blog to track learnings and feelings."\n        title=""\n        src="/static/1-60fea4c6e45ceda49cc13c40965ddef4-d564d.jpg"\n        srcset="/static/1-60fea4c6e45ceda49cc13c40965ddef4-865fd.jpg 240w,\n/static/1-60fea4c6e45ceda49cc13c40965ddef4-d40a0.jpg 480w,\n/static/1-60fea4c6e45ceda49cc13c40965ddef4-d564d.jpg 960w,\n/static/1-60fea4c6e45ceda49cc13c40965ddef4-c67c1.jpg 1440w,\n/static/1-60fea4c6e45ceda49cc13c40965ddef4-5b032.jpg 1800w"\n        sizes="(max-width: 960px) 100vw, 960px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p><em>I agree with one theory that successful individuals are disciplined and have full autonomy. However people usually develop autonomy from heteronomy. For instance when we study with classmates and work with teammates, we are motivated to be a better person from others inspiration and expectation. So I just want to start using this blog to leverage internet’s heteronomy to motivate myself to write more and track learnings, bookings, feelings.</em></p>\n<p>Most of articles about tech would be written in English but others maybe in 中文.</p>',frontmatter:{title:"About me",date:null,description:null}}},pathContext:{slug:"/about"}}}});
